<!DOCTYPE html>
<html>
<head>
<meta charset='utf-8'>
<style TYPE='text/css'>
body {
	background-color: #252525;
	color: #e8e8e8
}

.highlighter .add { 
	background-color: #1c7b50;
}

.highlighter .remove { 
	background-color: #80372b;
}

.highlighter td.modify { 
	background-color: #2c5075;
}

.highlighter td.conflict { 
	background-color: #c72c41;
}

.highlighter .spec { 
	background-color: #505050;
}

.highlighter .move { 
	background-color: #353535;
}

.highlighter .null { 
	color: #666;
}

.highlighter table { 
	border-collapse:collapse;
}

.highlighter td, .highlighter th {
	border: 1px solid #444;
	padding: 3px 7px 2px;
}

.highlighter th, .highlighter .header, .highlighter .meta {
	background-color: #636363;
	font-weight: bold;
	padding-bottom: 4px;
	padding-top: 5px;
	text-align:left;
}

.highlighter tr.header th {
	border-bottom: 2px solid black;
}

.highlighter tr.index td, .highlighter .index, .highlighter tr.header th.index {
	background-color: #4a4a4a;
	border: none;
}

.highlighter .gap {
	color: #666;
}

.highlighter td {
	empty-cells: show;
	white-space: pre-wrap;
}
</style>
</head>
<body>
<div class='highlighter'>
<table>
<thead>
<tr class="header"><th>@@</th><th>﻿key: int32</th><th>0: str</th></tr>
</thead>
<tbody>
<tr class="gap"><td>...</td><td>...</td><td>...</td></tr>
<tr><td></td><td>5104</td><td>Ulrike Hübschmann</td></tr>
<tr class="modify"><td class="modify">→</td><td>5105</td><td class="modify">→Kohei Yoshiwara</td></tr>
<tr><td></td><td>5106</td><td></td></tr>
<tr class="gap"><td>...</td><td>...</td><td>...</td></tr>
<tr><td></td><td>8011</td><td>Credits Released: 05/2022</td></tr>
<tr class="modify"><td class="modify">→</td><td>8012</td><td class="modify">Voice Cast Updated: 01/2023→Voice Cast Updated: 05/2023</td></tr>
<tr class="modify"><td class="modify">→</td><td>8013</td><td class="modify">→Voice Cast Updated: 09/2023</td></tr>
<tr class="modify"><td class="modify">→</td><td>8014</td><td class="modify">→Voice Cast Updated: 10/2023</td></tr>
<tr><td></td><td>8015</td><td></td></tr>
<tr class="gap"><td>...</td><td>...</td><td>...</td></tr>
</tbody>
</table>
</div>
</body>
</html>
